// Recipient_Dashboard.js

// Importing necessary dependencies from React and React Router
import React from "react";
import { Routes, Route, useParams } from "react-router-dom";

// Importing the RecipientSidebar component and the styling for the dashboard
import RecipientSidebar from "./RecipientSidebar.js";
import "./RecipientDashboard.css";

// Importing the Feedback component
import Feedback from "../Feedback.js";

// Functional component for the recipient dashboard
const Recipient_Dashboard = () => {
  return (
    // Main container for the recipient dashboard
    <div className="recipient-dashboard">
      {/* Sidebar component for navigation */}
      <RecipientSidebar />
      {/* Content area for the dashboard */}
      <div className="recipient-content">
        {/* Setting up routes for different dashboard sections */}
        <Routes>
          {/* Route for the dashboard home */}
          <Route path="/" element={<DashboardHome />} />
          {/* Route for the feedback section */}
          <Route path="/feedback" element={<Feedback />} />
        </Routes>
      </div>
    </div>
  );
};

// Functional component for the home section of the dashboard
const DashboardHome = () => {
  return (
    // Container for the main content of the home section
    <div className="mainContainer">
      {/* Heading for the home section */}
      <h2>Welcome to your Dashboard!</h2>
      {/* Description for the home section */}
      <p>This is the homepage. You can navigate to other sections using the
        sidebar.
      </p>
    </div>
  );
};

// Exporting the Recipient_Dashboard component as the default export
export default Recipient_Dashboard;
